webpackJsonp([0xd055cc3323d0],{623:function(e,t){e.exports={data:{allMarkdownRemark:{totalCount:1,edges:[{node:{fields:{slug:"/gotta-catch-em-all-again"},excerpt:"After introducing Ethan to Pokémon a couple of months ago, this morning we finished rewatching the 82 episode strong first season. It’s…",timeToRead:1,frontmatter:{title:"Gotta Catch ‘Em All (again)",tags:["entertainment","tv","pokemon","family","personal"],cover:"/images/pokemon-banner.jpg",date:"2018-05-29T21:49"}}}]},authors:{edges:[{node:{id:"eddie",name:"Eddie Lee",image:"/images/eddielee.jpg",url:"https://twitter.com/eddielee6",bio:"Father and Software Engineer"}}]}},pathContext:{tag:"pokemon",nodes:[{node:{frontmatter:{title:"Gotta Catch ‘Em All (again)",tags:["entertainment","tv","pokemon","family","personal"],cover:"/images/pokemon-banner.jpg",date:"2018-05-29T21:49",author:"eddie"},fields:{slug:"/gotta-catch-em-all-again"},html:'<p>After introducing Ethan to Pokémon a couple of months ago, this morning we finished rewatching the 82 episode strong first season. It’s surprising how well a children’s TV show from 1997 still holds up today. A lot of it will be nostalgia for me; but Ethan is watching it as a child for the first time over 20 years after its debut - and he loves it.</p>\n<p><img src="/images/pokemon-ethan-book.jpg" alt="Ethan with my old Pokémon book"></p>\n<p>Over the last couple of months he has become obsessed with Pokémon; our house is slowly filling with toys, books, cards, clothes, and a mass of other Pokémon merchandise. It’s really surprising how quickly he’s learnt the names of all the Pokémon, much quicker than learning the far fewer letters of the alphabet a few years previous.</p>\n<p>Its going to be great fun when he’s old enough to play the games; lets see if he can beat me in battle on Pokémon Red and Blue. But for now we’ll stick with the TV show; next up is the emotional rollercoaster of <a href="https://www.imdb.com/title/tt0190641/">Pokémon: The First Movie - Mewtwo Strikes Back</a>.</p>\n<p><img src="/images/pokemon-movie-still.jpg" alt="Pokémon: The First Movie - Mewtwo Strikes Back"></p>',timeToRead:1}}],page:1,pages:1,total:1,limit:5}}}});
